      },
      "annotatedText": {
        "value": "The regulatory authority shall have the following duties: fixing or approving, in accordance with transparent criteria, transmission or distribution tariffs or their methodologies, or both; ensuring the compliance of transmission system operators and distribution system operators and, where relevant, system owners, as well as the compliance of any electricity undertakings and other market participants, with their obligations under this directive, regulation (eu) 2019/943, the network codes and the guidelines adopted pursuant to articles 59, 60 and 61 of regulation (eu) 2019/943, and other relevant union law, including as regards cross-border issues, as well as with acer's decisions; in close coordination with the other regulatory authorities, ensuring the compliance of the entso for electricity and the eu dso entity with their obligations under this directive, regulation (eu) 2019/943, the network codes and guidelines adopted pursuant to articles 59, 60 and 61 of regulation (eu) 2019/943, and other relevant union law, including as regards cross-border issues, as well as with acer's decisions, and jointly identifying non-compliance of the entso for electricity and the eu dso entity with their respective obligations; where the regulatory authorities have not been able to reach an agreement within a period of four months after the start of consultations for the purpose of jointly identifying non-compliance, the matter shall be referred to the acer for a decision, pursuant to article 6(10) of regulation (eu) 2019/942; approving products and procurement process for non-frequency ancillary services; implementing the network codes and guidelines adopted pursuant to articles 59, 60 and 61 of regulation (eu) 2019/943 through national measures or, where so required, coordinated regional or union-wide measures; cooperating in regard to cross-border issues with the regulatory authority or authorities of the member states concerned and with acer, in particular 