 electricity exchanges, prices for household customers including prepayment systems, the impact of dynamic electricity price contracts and of the use of smart metering systems, switching rates, disconnection rates, charges for maintenance services, the execution of maintenance services, the relationship between household and wholesale prices, the evolution of grid tariffs and levies, and complaints by household customers, as well as any distortion or restriction of competition, including by providing any relevant information, and bringing any relevant cases to the relevant competition authorities; monitoring the occurrence of restrictive contractual practices, including exclusivity clauses which may prevent customers from contracting simultaneously with more than one supplier or restrict their choice to do so, and, where appropriate, informing the national competition authorities of such practices; monitoring the time taken by transmission system operators and distribution system operators to make connections and repairs; helping to ensure, together with other relevant authorities, that the consumer protection measures are effective and enforced; publishing recommendations, at least annually, in relation to compliance of supply prices with article 5, and providing those recommendations to the competition authorities, where appropriate; ensuring non-discriminatory access to customer consumption data, the provision, for optional use, of an easily understandable harmonised format at national level for consumption data, and prompt access for all customers to such data pursuant to articles 23 and 24; monitoring the implementation of rules relating to the roles and responsibilities of transmission system operators, distribution system operators, suppliers, customers and other market participants pursuant to regulation (eu) 2019/943; monitoring investment in generation and storage capacities in relation to security of supply; monitoring technical cooperation between union and third-country transmission system operators; contributing to the compatibility of data exchange processes for the most important market processes at regional level; monitoring the availability of comparison tools that meet the requirements set out in article 14; monitoring the removal of unjustified obstacles to and restrictions on the development of consumption of self-generated electricity and citizen energy communities."
