          "annotatedText": "by 31 October 2020, the m0 value in point 4 of part a of annex i shall be adjusted to the average mass in running order of all new passenger cars registered in 2017, 2018, and 2019. that new m0 value shall apply from 1 January 2022 until 31 December 2024"
        },
        {
          "id": "Time_Compliance",
          "annotatedText": "by 31 October 2022, the m0 value in point 4 of part b of annex i shall be adjusted to the average mass in running order of all new light commercial vehicles registered in 2019, 2020 and 2021. that new m0 value shall apply in 2024"
        },
        {
          "id": "Time_Compliance",
          "annotatedText": "by 31 October 2022, the indicative tm0 value for 2025 shall be determined as the respective average test mass of all new passenger cars and new light commercial vehicles registered in 2021"
        },
        {
          "id": "Time_Compliance",
          "annotatedText": "by 31 October 2024, and every second year thereafter, the tm0 value in point 6.2 of parts a and b of annex i shall be adjusted to the respective average test mass of all new passenger cars and new light commercial vehicles registered in the preceding two calendar years, starting with 2022 and 2023. the new tm0 values shall apply from 1 January of the calendar year following the date of the adjustment"
        }
      ],
      "grants_legislative_authority": {
        "id": "eurovoc:4038",
        "label": "European Commission"
      }
